query GetNftModelsForUrls {
                nft_nft(where: {
                    denom_id: {_in: [${this.denomIds.map((denom) => `"${denom}"`).join(',')}]},
                    burned: {_eq: false}
                  },
                  distinct_on: denom_id
                ) {
                    uri
                    denom_id
                  }
              }
